import React, { useEffect } from "react";
import { getBookingsForWeek } from "../../02/bookingServices";
import { useBooking } from "../BookingContext";

function RoomLeft() {
  const data = [
    { time: "13:00 - 14:00", title: "Lunch with Petr" },
    { time: "15:00 - 16:00", title: "Sales Weekly Meetinhtr" },
    { time: "16:00 - 18:00", title: "Anastasia Website Warroom" },
  ];

  const { schedule, setSchedule } = useBooking();

  useEffect(() => {
    try {
      setSchedule(getBookingsForWeek("A101", 0));
    } catch (err) {
      console.log(err);
    }
  }, []);

  console.log(schedule);

  return (
    <div className="left-booking">
      <div className="room-id-container">
        <p className="room-id text-54 font-700">A101</p>
      </div>

      <div className="upcoming-container">
        <p className="text-18 font-700">Upcoming</p>

        <div className="">
          <p className="text-64 opacity-50 font-300">Monday</p>
          <p className="text-64">28 Sep</p>
        </div>
      </div>
    </div>
  );
}

export default RoomLeft;
